webpackJsonp([0x96bf5b84edf4],{7935:function(e,t){e.exports={data:{post:{html:"<p>If you haven't noticed on the sidebar, I've been sending a couple of tweets each to <a href=\"http://twitter.com/papascott\">Twitter</a>. They aren't all that interesting, since I'm either at home or in the restaurant, and I haven't yet gotten in the habit of sending tweets from work. You can also find me on <a href=\"http://www.facebook.com/profile.php?id=666521280\">Facebook</a>, if you're into that.</p>\n<p>I have today off, though, and Christopher and I will be off on a grand expedition searching for mummies and dinosaurs. That's right, we're taking a day trip with the ICE to Berlin where we'll check out some museums and the Lego Discovery Center. We won't be home until after dark.</p>",fields:{title:"Twitter Me Do",date:"23 Aug 2007",url:"https://papascott.de/2007-08-23-twitter-me-do/"}}},pathContext:{slug:"/2007-08-23-twitter-me-do/",prev:{fields:{title:"Two More Weeks",date:"20 Aug 2007",slug:"/2007-08-20-two-more-weeks/"}},next:{fields:{title:"In Common",date:"24 Aug 2007",slug:"/2007-08-24-in-common/"}}}}}});
